    "2015-09-26T23:18:07.627536",nt"name": "duzce-turkey-earthquake-november-12-1999",nt"isopen":
    false,nt"url": null,nt"notes": "The magnitude 7.2 quake occurred at 6.57
    pm local time (16:57 GMT). Duzce lies on the eastern fringe of the region hit by
    the August 17 quake. Some areas experienced a one-two punch from the 1999 earthquakes.
    The death toll from the November quake was reported to be 260 people. More than
    1,282 were injured and at least 102 buildings were destroyed.",nt"license_title":
